import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import "../styles/onboarding.css";

function Onboarding() {
  useEffect(() => {
    // Ensure JotForm script loads dynamically
    const script = document.createElement("script");
    script.src = "https://form.jotform.com/jsform/250766976613166"; // Replace with your JotForm Embed URL
    script.type = "text/javascript";
    script.async = true;
    document.getElementById("jotform-embed").appendChild(script);

    return () => {
      document.getElementById("jotform-embed").innerHTML = "";
    };
  }, []);

  return (
    <div className="about-container">
      <div className="top-nav-container">
        <nav className="top-nav">
          <Link to="/" className="nav-item-black">HOME</Link>
          <Link to="/services" className="nav-item-black">SERVICES</Link>
          <Link to="/work" className="nav-item-black">OUR WORK</Link>
          <Link to="/about" className="nav-item-black">ABOUT</Link>
          <Link to="/contact" className="nav-item-black">CONTACT</Link>
        </nav>
        <div className="logo-container">
          <img src="/assets/maeknit-no-bg-logo.png" alt="Logo" className="logo" />
        </div>
      </div>

      {/* JotForm Section */}
      <div className="form-section">
        <h2 className="form-header">Get Started with MAEKNIT</h2>
        <p className="form-subtext">Fill out the form below to begin your onboarding process.</p>

        <div className="jotform-container">
          <div id="jotform-embed"></div> {/* JotForm will load here dynamically */}
        </div>
      </div>
    </div>
  );
}

export default Onboarding;
